INSERT INTO `cs_ask`(`ask_id`, `parent_id`, `user_id`, `ask_type`, `type`, `title`, `ask`, `answer`, `status`, `is_delete`, `create_time`) VALUES (154, 0, 84, 3, 0, '计算机的本质是什么？逻辑？数学？', '', '', 1, 1, 1562121522);
INSERT INTO `cs_ask`(`ask_id`, `parent_id`, `user_id`, `ask_type`, `type`, `title`, `ask`, `answer`, `status`, `is_delete`, `create_time`) VALUES (155, 154, 1, 3, 1, '', '1946年，在美国的宾夕法尼亚大学诞生了第一台现代电子计算机ENIAC。虽然在今天看来ENIAC计算能力连手机，甚至是十几块钱的计算器都比不上，但它在当时却是相当强大。ENIAC的体积非常庞大，得好几个大房间才能放下它，耗电也相当恐怖，一开机全城家家户户电灯都要变暗。', '', 0, 1, 1562121522);
INSERT INTO `cs_ask`(`ask_id`, `parent_id`, `user_id`, `ask_type`, `type`, `title`, `ask`, `answer`, `status`, `is_delete`, `create_time`) VALUES (156, 154, 1, 3, 1, '', '之所以称ENIAC是第一台现代计算机，是因为现代计算机理论的奠基人是图灵和冯诺依曼。这两个超级天才应该大家都听过，图灵提出了图灵机理论模型，而冯诺依曼设计确定了现代计算机的基础结构，他以数学语言阐述了计算机模型，将程序和数据都存在存储器中。', '', 0, 1, 1562121586);
INSERT INTO `cs_ask`(`ask_id`, `parent_id`, `user_id`, `ask_type`, `type`, `title`, `ask`, `answer`, `status`, `is_delete`, `create_time`) VALUES (157, 154, 1, 3, 1, '', '实际上，计算机的发展并非一蹴而就。现代电子计算机属于狭义上的计算机，而广义上的计算机其实包括所有人类制造出来的计算设备，比如古代的算盘也属于计算机，只不过它是靠人力驱动的，再比如机械式计算机，使用机械齿轮来进行运算。', '', 0, 1, 1562121600);
INSERT INTO `cs_ask`(`ask_id`, `parent_id`, `user_id`, `ask_type`, `type`, `title`, `ask`, `answer`, `status`, `is_delete`, `create_time`) VALUES (158, 154, 1, 3, 2, '', '', '在广义上，对于计算机我们更应该将其理解为一种思想。计算机其实是为了帮助人类将思想转化为代码仿真出来，这就要求我们需要先对思想进行解码工作。而在古代就已经有先贤在逻辑学和数学方面进行研究，其中最伟大的思想家就是柏拉图和亚里士多德，他们俩也互为师生关系。', 0, 1, 1562121630);
INSERT INTO `cs_ask`(`ask_id`, `parent_id`, `user_id`, `ask_type`, `type`, `title`, `ask`, `answer`, `status`, `is_delete`, `create_time`) VALUES (159, 154, 1, 3, 2, '', '', '亚里士多德首次将哲学与科学分离，并在逻辑方面进行了研究，他认为逻辑是一切科学的基础，是形式逻辑学的创始人奠基人。他将人的思维和存在联系起来，然后根据实际阐明逻辑。亚里士多德在推理逻辑中提出了三段论：', 0, 1, 1562121643);
INSERT INTO `cs_ask`(`ask_id`, `parent_id`, `user_id`, `ask_type`, `type`, `title`, `ask`, `answer`, `status`, `is_delete`, `create_time`) VALUES (160, 154, 1, 3, 2, '', '', '1.所有动物都会死所有人都是動物所以，所有人都會死\n2.所以，所有人都會死', 0, 1, 1562121729);
